import React from "react";
import { useState } from "react";
import { FaTimes } from "react-icons/all";
import classNames from "classnames";
const StockTableRow = ({ stock, onDelete }) => {
    const billion = 1000000000
    return(
         <tr key={ stock.ticker }>
             <td className='delete'> <FaTimes style={{ color:'red', cursor: 'pointer' }} onClick={ () => onDelete(stock) }/> </td>
             <td>{ stock.ticker }</td>
             <td>{ stock.companyName }</td>
             <td>{ stock.sector }</td>
             <td>{ stock.currentPrice }</td>
             <td >{ (stock.marketCap /billion).toFixed(2) }</td>
             <td>{ (stock.enterpriseValue /billion).toFixed(2) }</td>
             <td>{ (stock.forwardPE).toFixed(2) }</td>
             <td>{ (stock.enterpriseToRev).toFixed(2) }</td>
             <td>{ (stock.enterpriseToEbitda).toFixed(2) }</td>
             <td>{ (stock.profitMargins).toFixed(3) }</td>
             <td>{ (stock.roe).toFixed(2) }</td>
         </tr>
    )

}
export default StockTableRow
